import React, { useState } from 'react'
import {BackgroundDiv, NamePage, BoxGrid} from '../pages/Repos_url'
import { TextButton, IconButton,ButtonEnter } from '../theme/Tema';
import {Box} from '@material-ui/core';
import axios from 'axios'
import { useParams } from 'react-router-dom';


function Starred() {
  const params = useParams()
  const [starred, setStarred] = useState([])

  const handle_starred = () => {
    axios.get(`https://api.github.com/users/${params}/starred`)
      .then((res) => {
        console.log(res.data)
       setStarred(res.data)
    
      }).catch((err) => {
        alert(err.messege)

      })
  }
  
  
  return (
      <BackgroundDiv>
      <Box bgcolor = 'white' height = '100px'>
    <NamePage className = 'iconP'>Starred</NamePage>
    </Box>
    <BoxGrid display= 'flex'>
   
    </BoxGrid>
 
    
  </BackgroundDiv>
    );
  }
  
  export default Starred;
